Een optocht of stoet is een georganiseerde trektocht, die meestal gehouden wordt om iets te manifesteren. Behalve voetgangers en wagens zijn ook andere voertuigen mogelijk. Zo kennen verschillende evenementen bij het water een botenparade en kunnen ook grote ballonnen onderdeel van een optocht zijn. Een optocht is een gecoördineerd gebeuren. Vaak willen de mensen in de stoet de toeschouwers iets vertellen. Personen in een stoet kunnen lopen, maar ook te paard zitten, of in een willekeurig vervoermiddel. Een proteststoet is over het algemeen een groep wandelende mensen, terwijl een rouwstoet of begrafenisstoet bestaat uit rouwende mensen. Soorten optochten zijn onder andere: 
* corso, waarin praalwagens meerijden; 
* parade, vaak militair; 
* defilé, waarin het vooral om een eerbetoon gaat; 
* vlootschouw, met schepen of vliegtuigen; 
* processie, een religieuze optocht (onder meer rooms-katholiek); 
* stille tocht; vaak gehouden als iemand is vermoord, dood is gevonden na een zoektocht of is verongelukt. 
* carnavalsoptocht; 
* cortège, optocht van in toga geklede hoogleraren aan het begin van het academisch jaar.
